import React, { useState } from 'react';
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import PersonIcon from '@mui/icons-material/Person';
import IconButton from '@mui/material/IconButton';
import ImageIcon from '@mui/icons-material/Image';
import Link from '@mui/material/Link';
import SearchIcon from '@mui/icons-material/Search';
import TextField from 'material-ui/TextField';


const Products= (username) =>{
    const [textsearch, settextsearch] = useState('');
    return (<div>
        <div style={{borderBottom:'solid'}}> 
        <AppBar position="static" style={colorB}>
            
            
        <Toolbar>
        <IconButton >
                       <ImageIcon />
          </IconButton>
          <Typography   sx={{ flexGrow: 1 }} style={text}>
           App Name
          </Typography>
          <Button style={text1}>{username}</Button>
          <IconButton>
                       <PersonIcon />
          </IconButton>
        </Toolbar>
      </AppBar></div>
      <div className="parentProducts">
<div className="childProducts"> 
   <div className="DivLink">
      <Link href="#"> All</Link>|
      <Link href="#" > Category 1</Link>|
      <Link href="#" > Category 2</Link>|
      <Link href="#">Link Category 3</Link>|
      <Link href="#" > Category 4</Link>
      
   </div>
   <div>
        
   <IconButton>
          <SearchIcon />
        </IconButton>
        
     
      
    


   </div>
</div>


      </div>
      </div>
    )
}
const text={
    color:"#1f1d1d",
    fontSize:"3vh",
    }
    const text1={
        color:"#1f1d1d",
        fontSize:"2vh",
        }
const colorB={
    background:"#ffffff",
  

}



export default Products;
